import React,{useState} from 'react';
import Table from './components/Table_Layout/Table';
import InputTable from './components/inputTable/InputTable';
import { Button } from '@mui/material';
import { Modal } from '@mui/material';
import BodyinModal from './components/modal/BodyinModal';
function App() {
  const [open, setOpen] = useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);


  return (
    <div>
      <div>
        <Button onClick={handleOpen}>Add Entry</Button>
          <Modal
          open={open}
          onClose={handleClose}
          aria-labelledby="modal-modal-title"
          aria-describedby="modal-modal-description"
          >
            <BodyinModal handleClose={handleClose}/>
          </Modal>
      </div>
      <div style={{width:900, height:300, margin: 30,padding:20}}> 
       <InputTable />
      </div>

    </div>
  );
}

export default App;
